CREATE TABLE ELEMENTS (
    ELEMENT_SYMBOL_ID VARCHAR2(2) NOT NULL,
    ELEMENT_NAME VARCHAR2(255) NOT NULL,
    ELEMENT_ATOMIC_MASS NUMBER NOT NULL,
    ELEMENT_PROTONS NUMBER(3) NOT NULL,
    ELEMENT_NEUTRONS NUMBER(3) NOT NULL
);

ALTER TABLE ELEMENTS ADD CONSTRAINT element_id_pk PRIMARY KEY (ELEMENT_SYMBOL_ID);

COMMENT ON TABLE ELEMENTS IS 'Elements of Periodic Table.';

